import "./basic.css";
import { useState } from "react";

let BasicJsx = () => {
     
  var id = 1;
  var name = "Nike Casuals";
  var stock = true;

  return(
      <div className="container-fluid">
          <h2>Product Details</h2>
          <dl>
              <dt>Product Id</dt>
              <dd>{id}</dd>
              <dt>Name</dt>
              <dd>{name}</dd>
              <dt>Stock</dt>
              <dd>{(stock==true)?"Available":"Out of Stock"}</dd>
          </dl>
      </div>

  )
};
export default BasicJsx;
